(2, 'English', 'What is Lorem Ipsum?', NULL, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry.', NULL, 'what-is-lorem-ipsum', 1, 3, '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span><br></p>', NULL, 1, 1, 1, '2018-04-05 12:49:00', NULL, 'What is Lorem Ipsum?', NULL, NULL, NULL, 0, 1, 1, NULL, NULL, '2018-04-05 07:05:43', '2018-04-05 07:38:34'),
(3, 'Both', 'Curabitur laoreet posuere commodo. Praesent a dapibus velit, a venenatis sem.', 'उक्त तालिममा बैंकका तर्फबाट नायब प्रमुख कार्यकारी अधिकृत दिनेश थकाली तथा केएफए का तर्फबाट रेष्टा झा तथा जस्मीन हाटा उपस्थीत थिए ।', 'Curabitur laoreet posuere commodo. Praesent a dapibus velit, a venenatis sem.', 'उक्त तालिममा बैंकका तर्फबाट नायब प्रमुख कार्यकारी अधिकृत दिनेश थकाली तथा केएफए का तर्फबाट रेष्टा झा तथा जस्मीन हाटा उपस्थीत थिए ।', 'curabitur-laoreet-posuere-commodo-praesent-a-dapibus-velit-a-venenatis-sem', 1, 5, '<p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Curabitur laoreet posuere commodo. Praesent a dapibus velit, a venenatis sem. Nulla est purus, fringilla pulvinar rutrum sit amet, venenatis vitae lacus. Curabitur tempus congue erat, sed tincidunt velit sodales sit amet. Integer dignissim placerat diam, id congue tortor eleifend ac.</p><p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Nunc dictum lobortis sem sit amet cursus. Interdum et malesuada fames ac ante ipsum primis in faucibus. Phasellus convallis, tortor eu pretium venenatis, ligula odio feugiat nisi, a porttitor neque libero nec leo. Aenean eget mi nec risus vehicula bibendum. Duis convallis interdum massa et consequat. Fusce congue posuere arcu sed euismod. Fusce id molestie sapien. Sed sed urna eu enim fringilla vestibulum.</p>', '<p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">काठमाडौं ।&nbsp; सांग्रिला डेभलपमेन्ट बैंकद्धारा यही मिति २०७४ साल चैत्र १७ गते केएफए सँगको सहयोग तथा सहकार्यमा बैंकास्योरेन्स सम्बन्धी एक दिने तालिम पोखरामा सफलतापुर्बक सम्पन्न गरेको छ ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">उक्त तालिममा बैंकका तर्फबाट नायब प्रमुख कार्यकारी अधिकृत दिनेश थकाली तथा केएफए का तर्फबाट रेष्टा झा तथा जस्मीन हाटा उपस्थीत थिए । उतm तालिमबाट बैंकका बिभिन्न तहका ४० जना भन्दा बढी कर्मचारी लाभान्वीत भएका थिए ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">बैँकले बिभिन्न बिमा कम्पनीसँग सहकार्य गरी आफ्ना ग्राहक बर्गलाई जिवन र निर्जिवन बिमाका बिबिध सेबाहरु प्रदान गर्ने कुरा नायब प्रमुख कार्यकारी अधिकृत दिनेश थकालीले बताएका थिए । बैंकले देशका बिभिन्न स्थानमा शाखा बिस्तार गर्न लागेको हुदाँ बिमा सम्बन्धीको सेबा पनि जनतामा बिस्तार हुने बिश्वास लिएको छ ।</p>', 0, 1, 1, '2018-04-05 13:50:00', NULL, 'Curabitur laoreet posuere commodo. Praesent a dapibus velit, a venenatis sem.', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '2018-04-05 08:10:55', '2018-04-05 08:10:55'),
(4, 'Both', 'Nunc dictum lobortis sem sit amet cursus. Interdum et malesuada fames ac ante ipsum primis in faucibus.', 'घट्दो बजारमा श्वेतपत्रले केही राहत दिन सक्ने लगानीकर्ताको अपेक्षा विभिन्न सामाजिक सन्जालमा व्यक्त भएको देखिन्थ्यो ।', 'Vestibulum blandit elit eu ligula iaculis, a tincidunt lorem consequat. Etiam eget sapien massa. Proin metus risus, blandit in enim nec, facilisis lacinia nunc.', 'अर्थमन्त्रीले बोलिदिए कै भरमा घट्दो बजारमा स्थीरता आउन सक्छ ?', 'nunc-dictum-lobortis-sem-sit-amet-cursus-interdum-et-malesuada-fames-ac-ante-ipsum-primis-in-faucibus', 2, 6, '<p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Curabitur laoreet posuere commodo. Praesent a dapibus velit, a venenatis sem. Nulla est purus, fringilla pulvinar rutrum sit amet, venenatis vitae lacus. Curabitur tempus congue erat, sed tincidunt velit sodales sit amet. Integer dignissim placerat diam, id congue tortor eleifend ac. Nunc dictum lobortis sem sit amet cursus. Interdum et malesuada fames ac ante ipsum primis in faucibus. Phasellus convallis, tortor eu pretium venenatis, ligula odio feugiat nisi, a porttitor neque libero nec leo. Aenean eget mi nec risus vehicula bibendum. Duis convallis interdum massa et consequat. Fusce congue posuere arcu sed euismod. Fusce id molestie sapien. Sed sed urna eu enim fringilla vestibulum.</p>', '<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px; text-align: justify;\">अर्थमन्त्रीले सेयर बजारलाई समेत समेट्दै श्वेतपत्र सार्वजनिक गरेका छन् । घट्दो बजारमा श्वेतपत्रले केही राहत दिन सक्ने लगानीकर्ताको अपेक्षा विभिन्न सामाजिक सन्जालमा व्यक्त भएको देखिन्थ्यो । श्वेतपत्र घट्दो बजारलाई ‘युटर्न’ गराउने औषधि बन्न सक्छ ? अर्थमन्त्रीले बोलिदिए कै भरमा घट्दो बजारमा स्थीरता आउन सक्छ ?</span><br></p>', 0, 1, 1, '2018-04-05 13:56:00', NULL, 'Nunc dictum lobortis sem sit amet cursus. Interdum et malesuada fames ac ante ipsum primis in faucibus.', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '2018-04-05 08:13:11', '2018-04-05 08:13:11');
