(5, 'Both', 'Pellentesque molestie, ante feugiat egestas pulvinar, risus nisi dapibus lorem, in sollicitudin lorem ex ut arcu.', 'श्वेतपत्रमा भनिएको छ ‘सेयर बजारको दायर साँघुरो छ’ । सेयर बजारको वास्तविकता पनि यही नै हो ।', 'ommodo mauris. Pellentesque molestie, ante feugiat egestas pulvinar, risus nisi dapibus lorem, in sollicitudin lorem ex ut arcu. Vestibulum effi', 'कतिपय कुरा सेयर बजारका अल्पकालिन कारोबारिलाई चित्त नबुझ्न सक्छ ।', 'pellentesque-molestie-ante-feugiat-egestas-pulvinar-risus-nisi-dapibus-lorem-in-sollicitudin-lorem-ex-ut-arcu', 2, 7, '<p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Praesent at orci id arcu tempor commodo. Nulla quis ornare lectus. Integer viverra nibh eget porttitor sodales. Suspendisse sit amet libero hendrerit, porttitor ipsum id, commodo mauris. Pellentesque molestie, ante feugiat egestas pulvinar, risus nisi dapibus lorem, in sollicitudin lorem ex ut arcu. Vestibulum efficitur pellentesque lorem, non aliquet tellus dictum nec. Duis tempus ipsum vitae eros dignissim laoreet a eget ante. Fusce imperdiet non tortor vel convallis.</p><div><br></div>', '<p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">मलाई त्यस्तो लाग्दैन । कसैले बोलेका भरमा बजारमा आउने उतारचढाव अल्पकालिन हो । दीर्घकालिन हुन सक्दैन । दीर्घकालमा बजारले आफ्नो दिशा आफै निर्धारण गर्दै जान्छ । लगानीकर्ताको चातुर्य भनेकै बजारको दिशालाई पछ्याउन सक्नु हो । अर्थमन्त्रीले श्वेतपत्रमा जे भनेका छन्, त्यसमा कसैलाई खुशी बनाउने वावाहवाही पाउने नाममा ढाँटेका छैनन् । सत्य भनेका छन् । कतिपय कुरा सेयर बजारका अल्पकालिन कारोबारिलाई चित्त नबुझ्न सक्छ ।</p>', 0, 1, 1, '2018-04-05 13:58:00', NULL, 'Pellentesque molestie, ante feugiat egestas pulvinar, risus nisi dapibus lorem, in sollicitudin lorem ex ut arcu.', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '2018-04-05 08:15:19', '2018-04-05 08:15:19'),
(6, 'Both', 'In et maximus miNunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi.', 'जस्तो अप्सन, वारेन्ट, कन्भर्टिभल, इटिएफ जस्ता डेरिभेटिम सहितका विकल्पको विकास गर्न सकिने कानुन र प्रविधि', 'In et maximus mi. Donec quis tortor eleifend leo eleifend varius a id enim. Nunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi.', 'जस्तो अप्सन, वारेन्ट, कन्भर्टिभल, इटिएफ जस्ता डेरिभेटिम सहितका विकल्पको विकास गर्न सकिने कानुन र प्रविधि', 'in-et-maximus-minunc-a-augue-elit-ut-elit-elit-imperdiet-in-malesuada-at-convallis-at-nisi', 3, 8, '<p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Praesent purus lacus, hendrerit a eros nec, dapibus hendrerit justo. Donec id felis sodales, tristique mauris nec, finibus sem. Etiam dignissim a nisl ut pulvinar. Curabitur ut iaculis nisl, nec pellentesque ipsum. Nullam ante nibh, tincidunt et arcu at, sagittis ultricies nibh. Maecenas dapibus dictum turpis, in pulvinar diam suscipit non. Aliquam erat volutpat. Duis vel feugiat ligula. Vivamus eleifend vulputate velit vel hendrerit.</p>', '<p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">पुँजी बजारको दायराका विभिन्न पक्ष छन् । उनले केही दायराको कुरा स्पष्ट गरेका छन् । पुँजी बजारमा लगानीका विकल्पको दायरा साँघुरो छ । जस्तो यहाँ साधारण सेयर वाहेकका विकल्प छैनभन्दा फरक पर्दैन । बजारका उतार चढाबमा हुने जोखिमलाई कम गर्न लगानीकर्ताले अन्य विकल्पको प्रयोग गर्न पाइरहेका छैनन् । जसले गर्दा एकोहोरो बजारमा लगानीकर्ता बढी निराश हुने गरेको देखिन्छ । जस्तो अप्सन, वारेन्ट, कन्भर्टिभल, इटिएफ जस्ता डेरिभेटिम सहितका विकल्पको विकास गर्न सकिने कानुन र प्रविधि भए लगानीका विकल्पको दायरा बढ्न सक्थ्यो ।</p>', 0, 1, 1, '2018-04-05 14:00:00', NULL, 'In et maximus miNunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi.', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '2018-04-05 08:18:03', '2018-04-05 08:18:03'),
