(10, 'Nepali', NULL, 'पोखरा महानगरमा फेसबुक प्रतिबन्ध', NULL, 'पोखरा । पोखरा लेखनाथ महानगरपालिकाको कार्यालय समयमा फेसबुक बन्द गरिएको छ', 'facebook-restricted-in-pokhara', 5, 10, NULL, '<p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">पोखरा । पोखरा लेखनाथ महानगरपालिकाको कार्यालय समयमा फेसबुक बन्द गरिएको छ ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">मोबाइल, ल्यापटप र डेस्कटपमा कर्मचारीले फेसबुक चलाउँदा सेवा प्रवाह नै प्रभावित भएको गुनासो आएपछि प्रमुख मानबहादुर जिसीको निर्देशनमा कार्यालय समयमा फेसबुक बन्द गरिएको हो ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">बिहान १०ः१५ देखि ४ बजेसम्म महानगरको कार्यालयमा जोडिएको इन्टरनेटबाट फेसबुक नचल्ने बनाइएको सूचना प्रविधि अधिकृत अशोक द्वारेले जानकारी दिए ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">उक्त समयमा फेसबुक नचल्ने बनाइएको छ । व्यक्तिसँग भएको निजी मोबाइल डाटाबाट फेसबुक चल्न सक्ने भएकाले, तोकिएको समयमा कर्मचारीले फेसबुक चलाएको पाइए तत्काल कारबाही गरिने प्रमुख जिसीले बताए । इन्टरनेटको राउटरमै फेसबुकको वेबसाइट ब्लक गरिएको हो ।</p>', 0, 1, 1, '2018-04-05 14:12:00', NULL, 'पोखरा महानगरमा फेसबुक प्रतिबन्ध', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '2018-04-05 08:30:39', '2018-04-05 08:30:39'),
(11, 'Both', 'Donec quis tortor eleifend leo eleifend varius a id enim', 'राजस्व बढाउने नाममा कर प्रशासन अराजक ढंगले प्रस्तुत भयोः गोल्छा', 'Nunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi.', 'सन्दर्भ मूल्य भन्सारका कर्मचारीले तयार पार्ने र त्यस्तो मूल्य ब्यवहारिक र कानुनी रुपमा बाध्यकारी नहुने निजी क्षेत्रको प्रतिक्रिया छ ।', 'donec-quis-tortor-eleifend-leo-eleifend-varius-a-id-enim', 5, 12, '<p><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\"> Nunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi. Fusce volutpat, odio et tempor commodo, orci tortor placerat tellus, ut pretium nibh turpis in tellus. Fusce quis feugiat magna, a vestibulum libero. In hac habitasse platea dictumst. Integer posuere massa at maximus feugiat.</span><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\"> </span><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\">Nunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi. Fusce volutpat, odio et tempor commodo, orci tortor placerat tellus, ut pretium nibh turpis in tellus. Fusce quis feugiat magna, a vestibulum libero. In hac habitasse platea dictumst. Integer posuere massa at maximus feugiat.</span><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\"> </span><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\">Nunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi. Fusce volutpat, odio et tempor commodo, orci tortor placerat tellus, ut pretium nibh turpis in tellus. Fusce quis feugiat magna, a vestibulum libero. In hac habitasse platea dictumst. Integer posuere massa at maximus feugiat.</span><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\"> </span><span style=\"font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\">Nunc a augue elit. Ut elit elit, imperdiet in malesuada at, convallis at nisi. Fusce volutpat, odio et tempor commodo, orci tortor placerat tellus, ut pretium nibh turpis in tellus. Fusce quis feugiat magna, a vestibulum libero. In hac habitasse platea dictumst. Integer posuere massa at maximus feugiat.</span><br></p>', '<p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: \"Ek Mukta\", serif; font-size: 19.2px;\">नेपाल उद्योग वाणिज्य महासंघले जहिले पनि न्यूनबिजकीकरण हुनुहुदैँन, स्वस्थ व्यापार हुनुपर्छ भन्ने ‘एड्भोकेसी’ गरेको छ । न्यूनबिजकीरणलाई ढाकछोप गर्ने गरेको छैन । अहिले राजस्व बढी उठाउने दबाब कर प्रशासनले महसुस गरेको देखिन्छ ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: \"Ek Mukta\", serif; font-size: 19.2px;\">व्यापार बढी भएपछि मात्रै राजस्व धेरै उठ्छ । भएको ब्यापारबाटै राजस्व बढाउने नाममा अहिले अलि अराकज तरिकाले राजस्व उठाएको जस्तो लागेको छ । न्यूनविजकीकरणको समस्या समाधान गर्न भन्सारसँग धेरै विकल्पहरु छन् । जस्तो कि पहिलो कुरा त सरकारले पीसीए गर्न सक्छ । भनिएको मूल्य साच्चै हो कि होइन भनेर भन्सारले चेक गर्न पनि सक्छ । यसो गर्ने अधिकार कानुनले नै दिएको छ । </p>', 0, 1, 1, '2018-04-05 14:15:00', NULL, 'Donec quis tortor eleifend leo eleifend varius a id enim', NULL, NULL, NULL, 0, 1, 1, NULL, NULL, '2018-04-05 08:33:43', '2018-04-05 08:34:38'),
(12, 'Both', 'Tenjing Energy Drinks in Nepali Market', 'तेन्जिङ इनर्जी ड्रिंक्स नेपाली बजारमा', 'Tenjing Energy Drinks in Nepali Market Tenjing Energy Drinks in Nepali Market', 'तेन्जिङ इनर्जी ड्रिंक्स नेपाली बजारमातेन्जिङ इनर्जी ड्रिंक्स नेपाली बजारमा', 'tenjing-energy-drinks-in-nepali-market', 6, 13, '<p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Praesent at orci id arcu tempor commodo. Nulla quis ornare lectus. Integer viverra nibh eget porttitor sodales. Suspendisse sit amet libero hendrerit, porttitor ipsum id, commodo mauris. Pellentesque molestie, ante feugiat egestas pulvinar, risus nisi dapibus lorem, in sollicitudin lorem ex ut arcu. Vestibulum efficitur pellentesque lorem, non aliquet tellus dictum nec. Duis tempus ipsum vitae eros dignissim laoreet a eget ante. Fusce imperdiet non tortor vel convallis.</p>', '<p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">काठमाडौं । पर्वातारोही तेन्जीङ शेर्पाको नाम उत्पादन गरिएको शक्तिवर्धक जुस ‘टेन्जीङ’ नेपाली बजारमा भित्र्याइएको छ । रेडबुलले शतप्रतिशत प्राकृतिक ड्रिंक्स ‘तेन्जिङ’ नेपाली बजारमा भित्र्याएको हो ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">पर्वातारोही तेन्जिङ शेर्पाको सम्झनामा उनको नाममा इनर्जी ड्रिंक्स उत्पादन गरिएको रेड बुलका मार्केटीङ डाइरेक्टर हिउव भ्यान बोकेलले जानकारी दिए ।</p><p style=\"margin-top: 15px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); text-align: justify; font-family: &quot;Ek Mukta&quot;, serif; font-size: 19.2px;\">प्राकृति ड्रिंक्स हिमाली ढुङ्गाको तत्व, हरियो कफी, बिट सुगर, गौराना र कागतीको रसबाट निर्माण गरिएको कम्पनीले दाबी गरेको छ । जुसमा ५ प्रतिशत प्रोटिनको मात्रा छ । जुसमा स्वास्थ्यलाई असर नगर्ने मात्रमा चिनी राखिएको कम्पनीले दाबी गरेको छ । ग्रीन टी समेत मिसाइएको ड्रिंक्स स्वास्थ्यका दुष्टीकोणले राम्रो मानिन्छ ।</p>', 0, 1, 1, '2018-04-05 14:19:00', NULL, 'Tenjing Energy Drinks in Nepali Market', NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '2018-04-05 08:37:49', '2018-04-05 08:37:49'),
